import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Photography from "../components/Photography"

const PhotographyPage = () => {
  return (
    <Container fluid>
      <p>pics</p>
      <Photography> small={`https://coryjquirk.github.io/portfolio/images/kulen.jpg`}
                large={`https://coryjquirk.github.io/portfolio/images/large/kulenlarge.jpg`}
                alt="Phnom Kulen"</Photography>
      <Photography small={`https://coryjquirk.github.io/portfolio/images/palisade.jpg`}
                large={`https://coryjquirk.github.io/portfolio/images/large/palisadelarge.jpg`}
                alt="Palisade Head"
                ></Photography>
    </Container>
  );
};

export default PhotographyPage;
